(5, 0, 1, 6, 'info', 'Articles', 'Articles page', '', '', 0, 1, 1, '2018-06-20 07:19:45', '2018-06-20 07:19:45'),
(6, 0, 1, 4, 'service', 'Service', 'Service page', '', '', 0, 1, 1, '2018-06-20 07:19:45', '2018-06-20 07:19:45'),
(7, 0, 1, 7, 'contacts', 'Contacts', 'Contacts page', '', '', 0, 1, 1, '2018-06-20 07:19:45', '2018-06-20 07:19:45'),
(8, 0, 1, 8, 'cart', 'Cart', 'Client cart page', '', '', 0, 1, 1, '2018-06-20 07:19:45', '2018-06-20 07:19:45'),
(9, 0, 1, 11, 'profile', 'Profile', 'Client profile page', '', '', 0, 1, 1, '2018-06-20 07:19:45', '2018-06-20 07:19:45'),
(10, 0, 1, 9, 'calculator', 'Calculator', 'Calculator page', '', '          <p>The modern world of crypto currency is reliable, secure and promising. The high level of its protection is due to decentralization of the accounting system and emissions, as well as functioning in a distributed computer network. You can earn the crypt by means of specialized devices - ASIC-miners and GPU-farms. Their main purpose is the calculation of algorithms: SHA-256, X11, Scrypt, etc.</p>\r\n                                    <p>The acquisition of new equipment for mining is carried out on the basis of calculations of future profits and expenses for energy consumed. Such calculations are considered quite laborious, in particular, when it is required to compare several types of devices. On the site, each user will be able to use a unique tool for automatic operations calculating the profit of miners and the level of electricity consumption.</p>\r\n                                    <h2>Cryptographic currency calculator: ease of use</h2>\r\n                                    <p>Use the crypto-currencies calculator (Bitcoin, Litecoin, Etherium, Dash) is simple enough. To do this, select the appropriate ASIC-Miner / GPU-farm from the drop-down menu or enter the hardware hash and press the \"Calculate\" button. As a result, the calculator will provide full information about the consumption of the miner, as well as all information about the earnings of the crypto currency with its automatic conversion into dollars, rubles, hryvnia, etc. At the same time, this tool is not limited to general data; it provides tables in which information on daily, weekly, monthly earnings in any desired currency is structured, as well as on the consumption of electricity in similar time ranges.</p>\r\n                                    <p>The calculator Kriplo-currency can significantly simplify the process of selecting the required equipment for mining by saving time on the calculations. As noted earlier, there is a drop-down list with miners in the calculator. All of them are presented in the store, therefore, after making a quick calculation, you can immediately find the optimal version of the ASIC-miner, after which you will be engaged in the crypto-currency mining.</p>\r\n                                    <p><span style=\"color: #999999;\"><em>*Absolute accuracy of exchange rates presented in the cryptocalculator is not guaranteed (this does not even help the minute synchronization with the largest crypto-exchange exchanges). That\'s why before making certain transactions, users should check the exchange rate to avoid unforeseen situations. It should be noted that the exchange rate of crypto currency is determined by the data received online from API exchanges. Such exchange rates are informational in nature, so they can change spontaneously, that is without prior notice. By the way, due to the constant fluctuations of the exchange rate, we are not responsible for the transactions made on the given data. All displayed information on exchange rates is not intended for use in investment transactions.</em></span></p>\r\n			', 0, 1, 1, '2018-06-20 07:19:45', '2018-06-20 07:19:45'),
(11, 0, 1, 12, 'checkout', 'Checkout', 'Checkout page', '', '', 0, 1, 1, '2018-06-20 07:19:45', '2018-06-20 07:19:45'),
