(322, 1, 1, 0, 1, 'ANTMINER S7 4.73 TH/s', 'antminer-s7-4-73-th-s', 'Antminer S7 – предыдущее поколение асик-майнера Bitmain, являющееся образцом прекрасного соотношения цена-качество. Благодаря своей демократической стоимости приобрести его могут многие пользователи.\r\n\r\nХарактерная особенность данного устройства – функциональное конструкционное исполнение. Майнер имеет алюминиевый корпус, снаружи которого размещены сетевой адаптер и кулер. На его лицевой части предусмотрен Ethernet-разъем и светодиоды.\r\n\r\nВнутри Antminer S7 – три параллельно подключенные платы, которые установлены по вертикали и оснащены радиаторами, отлично справляющимися с задачей теплоотвода. Каждая плата охлаждается цельным радиатором и комплектом индивидуальных радиаторов. В верхней части плат располагается интерфейс питания. Хеширование в данном устройстве осуществляется со скоростью 4,73 TH/s за счет наличия 135 чипов.\r\n\r\nАсик-майнер S7 – первый продукт Bitmain, оснащенный чипами четвертого поколения BM1385 (до этого подобные устройства снабжались чипами BM1384). Эти чипы обладают большой вычислительной мощностью и экономичностью в плане энергопотребления. В настоящее время они считаются наиболее энергоэффективными.\r\n\r\nОтсутствие блока питания в устройстве – еще один «плюс» для пользователей, так как им не придется переплачивать за имеющиеся комплектующие.', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(323, 1, 1, 0, 1, 'ANTMINER R4 8.7 TH/s', 'antminer-r4-8-7-th-s', 'Antminer R4 – уникальный продукт, созданный специалистами Bitmain. Его вычислительные процессы совершаются со скоростью 8,6 TH/s, следовательно, это второй по скорости майнер (большей скоростью обладает лишь Antminer S9/T9).  Конструкционное исполнение данного устройства предусматривает наличие чипа BM1387, созданного компанией Bitmain при использовании технологии 16nm FinFET. Кстати, это решение обеспечило наивысшую эффективность майнера в сфере добычи криптовалюты (Antminer R4 потребляет 0,098 Дж на 1GH/s).\r\n\r\nПредставленный майнер отличается простотой эксплуатации. С его настройкой справится даже начинающий специалист по майнингу биткоинов. Особого внимания заслуживает удобный пользовательский интерфейс. Еще одно немаловажное свойство майнера данной модели – способность настраивать скорость вращения вентилятора. Такое качество позволяет минимизировать шум, что очень важно при домашнем использовании устройства.\r\n\r\nAntminer R4 оснащен центробежным вентилятором, уровень шума которого при максимальной работе составляет всего 52 дБ, что равноценно громкости обыкновенного разговора. Наибольшая мощность хеширования достигается при условии применения блока питания APW5 мощностью 2,6 кВт.\r\n\r\nКомпактные габариты устройства – традиционное качество для майнеров Bitmain. Благодаря им Antminer R4 можно разместить на самой обычной полке.', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(324, 1, 1, 0, 1, 'ANTMINER T9 12.5 TH/s', 'antminer-t9-12-5-th-s', '<p>Antminer T9 – одна из последних новинок в линейке майнеров, выпускаемых компанией Bitmain. Эта модель обладает множеством конкурентных преимуществ. В устройстве великолепно сочетаются две основные характеристики, производительность и энергоэффективность. Более того, он отличается компактностью (габариты корпуса 30,1×12,3×15,5 см) и отличным охлаждением.</p>\r\n<p>Простота эксплуатации – еще одно значимое достоинство представленного устройства, ведь для его введения в работу не требуются специальные знания. Майнер функционирует автономно и обладает легкой настройкой.</p>\r\n<p>Следует отметить, что Antminer T9 – один из немногих майнеров в мире, оснащенный чипами ВМ1387. При этом в устройстве их насчитывается 171 штук. Мощность хеширования составляет 12,5 TH/s ±5%. Охлаждают конструкцию два вентилятора. Заявленная производителем потребляемая мощность – 1,57 кВт, правда, чтобы добиться такого значения, нужно придерживаться инструкции. Асик-майнер S9 считается достаточно экономичным и это подтверждается количеством потребляемой энергии (0,1 Дж на 1GH/s).</p>\r\n<p>Специалисты Bitmain, разрабатывавшие Antminer T9, учли пожелания потребителей, поэтому майнер совместим с блоками питания, которыми оснащались более старые модели асиков.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(325, 1, 1, 0, 1, 'ANTMINER S9 13.5TH/s', 'antminer-s9-13-5th-s-ru', '<p>Antminer S9 – одна из последних новинок в линейке майнеров, выпускаемых компанией Bitmain. Эта модель обладает множеством конкурентных преимуществ. В устройстве великолепно сочетаются две основные характеристики, производительность и энергоэффективность. Более того, он отличается компактностью (габариты корпуса 30,1×12,3×15,5 см) и отличным охлаждением.</p>\r\n<p>Простота эксплуатации – еще одно значимое достоинство представленного устройства, ведь для его введения в работу не требуются специальные знания. Майнер функционирует автономно и обладает легкой настройкой.</p>\r\n<p>Следует отметить, что Antminer S9 – один из немногих майнеров в мире, оснащенный чипами ВМ1387. При этом в устройстве их насчитывается 189 штук. Мощность хеширования составляет 13.5 TH/s ±5%. Охлаждают конструкцию два вентилятора. Заявленная производителем потребляемая мощность – 1,32 кВт, правда, чтобы добиться такого значения, нужно придерживаться инструкции. Асик-майнер S9 считается достаточно экономичным и это подтверждается количеством потребляемой энергии (0,1 Дж на 1GH/s).</p>\r\n<p>Специалисты Bitmain, разрабатывавшие Antminer S9, учли пожелания потребителей, поэтому майнер совместим с блоками питания, которыми оснащались более старые модели асиков.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(398, 1, 1, 0, 1, 'Вентилятор 6000RPM', 'fan_6000rpm', '<p>Совместим с:</p>\r\n<ul>\r\n	<li>Antminer S9 (Перед)</li>\r\n	<li>Antminer T9 (Перед)</li>\r\n	<li>Antminer L3+ (Зад)</li>\r\n	<li>Antminer D3 (Перед и зад)</li>\r\n</ul>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
