(403, 1, 1, 0, 1, 'APW5 12V 2600W', 'apw5-12v-2600w', '', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(405, 1, 1, 0, 1, 'AntRouter R1', 'antrouter-r1', '<p id=\"tw-target-text\" dir=\"ltr\" data-placeholder=\"Перевод\"><span lang=\"ru\">AntRouter R1 - это беспроводное сетевое устройство, содержащее чип для добычи биткойнов. Он не такой мощный, как обычный биткойн-майнер, но, пока устройство настроено правильно и включено, вы конкурируете за возможность решить блок и выиграть награду за блок 12,5 биткойнов (минус плата за пул 1%), Каждые 10 минут! </span></p>\r\n<p dir=\"ltr\" data-placeholder=\"Перевод\"><span lang=\"ru\">Устройство имеет несколько функций:</span></p>\r\n<ul>\r\n	<li dir=\"ltr\" data-placeholder=\"Перевод\"><span lang=\"ru\">Общий беспроводной маршрутизатор.  Держите R1 в сети для использования в качестве стандартного беспроводного маршрутизатора, поддерживая ваши телефоны и компьютеры, подключенные к Интернету дома или в офисе.</span></li>\r\n	<li dir=\"ltr\" data-placeholder=\"Перевод\"><span lang=\"ru\">Высокоскоростное USB-зарядное устройство.  Используя USB-кабель, подключите мобильное устройство к R1, чтобы зарядить его. Поддерживаются телефоны Android, iPhone и планшеты.</span></li>\r\n	<li dir=\"ltr\" data-placeholder=\"Перевод\">Подключите AntRouter R1 к маршрутизатору, концентратору или любому доступному источнику интернета, а устройство уже подключит доступ к Интернету через кабель. Это режим работы по умолчанию для R1.</li>\r\n</ul>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(422, 1, 1, 0, 1, 'ANTMINER L3+ 504MH/s', 'antminer-l3-504mh-s-nov', '<p>AntMiner L3+ - самый мощный майнер по добыче лайткоинов на текущий момент, в основе которых – алгоритм шифрования Scrypt. Его хешрейт достигает 504 МH/s, при этом энергопотребление составляет всего 800 Вт/ч.</p>\r\n<p>Особенностями представленного асик-майнера являются лучшие показатели производительности и энергопотребления, если сравнивать его с предыдущей моделью AntMiner L3. Производительность удалось увеличить практически в два раза за счет использования большего количества чипов. В данной модели их  288 шт.</p>\r\n<p>В целом, конструкционное исполнение устройство схоже с его предшественниками. Главным отличием является наличие четырех хеш-плат, на каждой из которых предусмотрено по 72 чипа BM1485. Частота вращения кулеров регулируется пользователем. Отдельно стоит отметить удобный пользовательский интерфейс.</p>\r\n<p>Рассчитывать на заявленные технические характеристики можно в том случае, если эксплуатировать AntMiner L3+ в соответствии с инструкцией, подготовленной производителем.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(430, 1, 1, 0, 1, 'БП MYRIG 12V 1680W', 'myrig1660', '<p>БП MYRIG обеспечивают максимальную мощность 1240 Вт, если он подключен к сетевому источнику питания 110 В. Чтобы получить номинальную мощность 1680 Вт, должен быть подключен к источнику питания 220 В. Перед заказом проверьте электропитание, которое является стандартным в вашем регионе.</p>\r\n<p>БП MYRIG поставляется только с 10 разъемами PCIe, поэтому их нельзя использовать с более чем одним майнером Antminer S9/T9/D3/L3+.</p>\r\n<p>&nbsp;</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(685, 1, 1, 0, 1, 'Плата управления S9/T9/R4', 'plata-upravleniya-s9-t9-r4', '<p>Совместим с:</p>\r\n<ul>\r\n	<li>Antminer S9</li>\r\n	<li>Antminer R4</li>\r\n	<li>Antminer T9</li>\r\n</ul>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(803, 1, 1, 0, 1, 'Дата кабель 18 pin', 'data_18pin', '<p>Совместим с:</p>\r\n<ul>\r\n	<li>Antminer S9 (Длинна - 18см)</li>\r\n	<li>Antminer S7 (Длинна - 14см)</li>\r\n	<li>Antminer T9 (Длинна - 18см)</li>\r\n	<li>Antminer L3+ (Длинна - 18см)</li>\r\n	<li>Antminer D3 (Длинна - 18см)</li>\r\n</ul>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(882, 1, 1, 0, 1, 'ANTMINER T9 12.5 TH/s', 'antminer-t9-12-5-th-s-2', '<p>Antminer T9 – одна из последних новинок в линейке майнеров, выпускаемых компанией Bitmain. Эта модель обладает множеством конкурентных преимуществ. В устройстве великолепно сочетаются две основные характеристики, производительность и энергоэффективность. Более того, он отличается компактностью (габариты корпуса 30,1×12,3×15,5 см) и отличным охлаждением.</p>\r\n<p>Простота эксплуатации – еще одно значимое достоинство представленного устройства, ведь для его введения в работу не требуются специальные знания. Майнер функционирует автономно и обладает легкой настройкой.</p>\r\n<p>Следует отметить, что Antminer T9 – один из немногих майнеров в мире, оснащенный чипами ВМ1387. При этом в устройстве их насчитывается 171 штук. Мощность хеширования составляет 12,5 TH/s ±5%. Охлаждают конструкцию два вентилятора. Заявленная производителем потребляемая мощность – 1,57 кВт, правда, чтобы добиться такого значения, нужно придерживаться инструкции. Асик-майнер S9 считается достаточно экономичным и это подтверждается количеством потребляемой энергии (0,1 Дж на 1GH/s).</p>\r\n<p>Специалисты Bitmain, разрабатывавшие Antminer T9, учли пожелания потребителей, поэтому майнер совместим с блоками питания, которыми оснащались более старые модели асиков.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(883, 1, 1, 0, 1, 'ANTMINER R4 8.7 TH/s', 'antminer-r4-8-7-th-s-2', 'Antminer R4 – уникальный продукт, созданный специалистами Bitmain. Его вычислительные процессы совершаются со скоростью 8,6 TH/s, следовательно, это второй по скорости майнер (большей скоростью обладает лишь Antminer S9/T9).  Конструкционное исполнение данного устройства предусматривает наличие чипа BM1387, созданного компанией Bitmain при использовании технологии 16nm FinFET. Кстати, это решение обеспечило наивысшую эффективность майнера в сфере добычи криптовалюты (Antminer R4 потребляет 0,098 Дж на 1GH/s).\r\n\r\nПредставленный майнер отличается простотой эксплуатации. С его настройкой справится даже начинающий специалист по майнингу биткоинов. Особого внимания заслуживает удобный пользовательский интерфейс. Еще одно немаловажное свойство майнера данной модели – способность настраивать скорость вращения вентилятора. Такое качество позволяет минимизировать шум, что очень важно при домашнем использовании устройства.\r\n\r\nAntminer R4 оснащен центробежным вентилятором, уровень шума которого при максимальной работе составляет всего 52 дБ, что равноценно громкости обыкновенного разговора. Наибольшая мощность хеширования достигается при условии применения блока питания APW5 мощностью 2,6 кВт.\r\n\r\nКомпактные габариты устройства – традиционное качество для майнеров Bitmain. Благодаря им Antminer R4 можно разместить на самой обычной полке.', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(884, 1, 1, 0, 1, 'ANTMINER S7 4.73 TH/s', 'antminer-s7-4-73-th-s-2', 'Antminer S7 – предыдущее поколение асик-майнера Bitmain, являющееся образцом прекрасного соотношения цена-качество. Благодаря своей демократической стоимости приобрести его могут многие пользователи.\r\n\r\nХарактерная особенность данного устройства – функциональное конструкционное исполнение. Майнер имеет алюминиевый корпус, снаружи которого размещены сетевой адаптер и кулер. На его лицевой части предусмотрен Ethernet-разъем и светодиоды.\r\n\r\nВнутри Antminer S7 – три параллельно подключенные платы, которые установлены по вертикали и оснащены радиаторами, отлично справляющимися с задачей теплоотвода. Каждая плата охлаждается цельным радиатором и комплектом индивидуальных радиаторов. В верхней части плат располагается интерфейс питания. Хеширование в данном устройстве осуществляется со скоростью 4,73 TH/s за счет наличия 135 чипов.\r\n\r\nАсик-майнер S7 – первый продукт Bitmain, оснащенный чипами четвертого поколения BM1385 (до этого подобные устройства снабжались чипами BM1384). Эти чипы обладают большой вычислительной мощностью и экономичностью в плане энергопотребления. В настоящее время они считаются наиболее энергоэффективными.\r\n\r\nОтсутствие блока питания в устройстве – еще один «плюс» для пользователей, так как им не придется переплачивать за имеющиеся комплектующие.', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(1070, 1, 1, 0, 1, 'Абонплата хостинга', 'abonplata-hostinga', '', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(1881, 1, 1, 0, 1, 'ANTMINER L3+ 504MH/s', 'antminer-l3-504mh-s-2', '<p>AntMiner L3+ - самый мощный майнер по добыче лайткоинов на текущий момент, в основе которых – алгоритм шифрования Scrypt. Его хешрейт достигает 504 МH/s, при этом энергопотребление составляет всего 800 Вт/ч.</p>\r\n<p>Особенностями представленного асик-майнера являются лучшие показатели производительности и энергопотребления, если сравнивать его с предыдущей моделью AntMiner L3. Производительность удалось увеличить практически в два раза за счет использования большего количества чипов. В данной модели их  288 шт.</p>\r\n<p>В целом, конструкционное исполнение устройство схоже с его предшественниками. Главным отличием является наличие четырех хеш-плат, на каждой из которых предусмотрено по 72 чипа BM1485. Частота вращения кулеров регулируется пользователем. Отдельно стоит отметить удобный пользовательский интерфейс.</p>\r\n<p>Рассчитывать на заявленные технические характеристики можно в том случае, если эксплуатировать AntMiner L3+ в соответствии с инструкцией, подготовленной производителем.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
