(4550, 1, 1, 0, 1, 'DRAGONMINT T1 16TH/s', 'dragonmint-16-th-s', '<p>DragonMint 16TH/s – последняя новинка на рынке оборудования для добычи Bitcoin, созданная компанией Halong Mining. Исходя из заявленных характеристик, более эффективного майнера SHA-256 на сегодняшний день не существует.</p>\r\n<p>Основная «изюминка» конструкции майнера – это чипы DM8575 . Именно они обеспечивают высокий хешрейт и энергоэффективность устройства, которая равна 0,075J/GH. DragonMint оснащен двумя вентиляторами, обеспечивающими нормальную работоспособность при температурах от 0 до +25.</p>\r\n<p>Над созданием данного майнера на протяжении года трудилось множество экспертов (одни занимались разработкой программного обеспечения, другие – аппаратного обеспечения, третьи – проектировали чипы). При этом была проведена огромная исследовательская работа. В результате, Halong Mining все-таки удалось выпустить уникальный продукт – DragonMint 16TH/s, обладающий великолепными техническими и эксплуатационными характеристиками.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(4652, 1, 1, 0, 1, 'DRAGONMINT T1 16TH/s', 'dragonmint-16-th-s-2', '<p>DragonMint 16TH/s – последняя новинка на рынке оборудования для добычи Bitcoin, созданная компанией Halong Mining. Исходя из заявленных характеристик, более эффективного майнера SHA-256 на сегодняшний день не существует.</p>\r\n<p>Основная «изюминка» конструкции майнера – это чипы DM8575 . Именно они обеспечивают высокий хешрейт и энергоэффективность устройства, которая равна 0,075J/GH. DragonMint оснащен двумя вентиляторами, обеспечивающими нормальную работоспособность при температурах от 0 до +25.</p>\r\n<p>Над созданием данного майнера на протяжении года трудилось множество экспертов (одни занимались разработкой программного обеспечения, другие – аппаратного обеспечения, третьи – проектировали чипы). При этом была проведена огромная исследовательская работа. В результате, Halong Mining все-таки удалось выпустить уникальный продукт – DragonMint 16TH/s, обладающий великолепными техническими и эксплуатационными характеристиками.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(5251, 1, 1, 0, 1, 'ANTMINER D3 19.3GH/s', 'antminer-d3-19-3gh-s', '<p>Antminer D3 – оборудование для майнинга, разработанное специалистами BITMAIN.  Устройство создано специально под алгоритм Х11, следовательно, на нем можно добывать одну из самых востребованных криптовалют – DASH. Кроме того, на таком алгоритме можно получить и другую цифровую валюту, например, QRK и CANN.</p>\r\n<p>Все составляющие антмайнера надежно зафиксированы. Платы в корпусе оборудования расположены почти впритык друг относительно друга. Минимальное расстояние между ними предусмотрено для эффективного охлаждения вентилятором.</p>\r\n<h3>В целом, Antminer D3 содержит следующих элементы:</h3>\r\n<ul>\r\n	<li>3 платы (на каждой из них закреплено по 60 чипов Х11);</li>\r\n	<li>2 вентилятора S9 с двухтактным режимом работы – отвечают за создание равномерного потока воздуха.</li>\r\n</ul>\r\n<p>Антмайнер потребляет 1200 Вт (110 В), а его эффективность составляет 93 %. В нем предусмотрено 10 разъемов (6-pin) и подключение Ethernet. Модификация блока питания этой модели MYRIG 1660W (APW3 ++ PSU). Номинальная мощность оборудования – 1200 Вт. Для ее получения Antminer D3 подключается к источнику питания 220 В.</p>\r\n<p>Настройка устройства осуществляется быстро и просто. При этом антмайнер D3 способен удерживать до 19,3 (в зависимости от батча) ГГц/с при 1186 Вт, правда, температура окружающей среды не должна быть выше +20 °С.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(5408, 1, 1, 0, 1, 'BITMAIN APW3++', 'bitmain-apw3', '<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(6147, 1, 1, 0, 1, 'ANTMINER S9 13.5TH/s + БП MYRIG', 'antminer-s9-13-5th-s-bp-myrig', '<p>Antminer S9 – одна из последних новинок в линейке майнеров, выпускаемых компанией Bitmain. Эта модель обладает множеством конкурентных преимуществ. В устройстве великолепно сочетаются две основные характеристики, производительность и энергоэффективность. Более того, он отличается компактностью (габариты корпуса 30,1×12,3×15,5 см) и отличным охлаждением.</p>\r\n<p>Простота эксплуатации – еще одно значимое достоинство представленного устройства, ведь для его введения в работу не требуются специальные знания. Майнер функционирует автономно и обладает легкой настройкой.</p>\r\n<p>Следует отметить, что Antminer S9 – один из немногих майнеров в мире, оснащенный чипами ВМ1387. При этом в устройстве их насчитывается 189 штук. Мощность хеширования составляет 13.5 TH/s ±5%. Охлаждают конструкцию два вентилятора. Заявленная производителем потребляемая мощность – 1,32 кВт, правда, чтобы добиться такого значения, нужно придерживаться инструкции. Асик-майнер S9 считается достаточно экономичным и это подтверждается количеством потребляемой энергии (0,1 Дж на 1GH/s).</p>\r\n<p>Специалисты Bitmain, разрабатывавшие Antminer S9, учли пожелания потребителей, поэтому майнер совместим с блоками питания, которыми оснащались более старые модели асиков.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(6149, 1, 1, 0, 1, 'ANTMINER S9 13.5TH/s + БП MYRIG', 'antminer-s9-13-5th-s-bp-myrig-ua', '<p>Antminer S9 – одна из последних новинок в линейке майнеров, выпускаемых компанией Bitmain. Эта модель обладает множеством конкурентных преимуществ. В устройстве великолепно сочетаются две основные характеристики, производительность и энергоэффективность. Более того, он отличается компактностью (габариты корпуса 30,1×12,3×15,5 см) и отличным охлаждением.</p>\r\n<p>Простота эксплуатации – еще одно значимое достоинство представленного устройства, ведь для его введения в работу не требуются специальные знания. Майнер функционирует автономно и обладает легкой настройкой.</p>\r\n<p>Следует отметить, что Antminer S9 – один из немногих майнеров в мире, оснащенный чипами ВМ1387. При этом в устройстве их насчитывается 189 штук. Мощность хеширования составляет 13.5 TH/s ±5%. Охлаждают конструкцию два вентилятора. Заявленная производителем потребляемая мощность – 1,32 кВт, правда, чтобы добиться такого значения, нужно придерживаться инструкции. Асик-майнер S9 считается достаточно экономичным и это подтверждается количеством потребляемой энергии (0,1 Дж на 1GH/s).</p>\r\n<p>Специалисты Bitmain, разрабатывавшие Antminer S9, учли пожелания потребителей, поэтому майнер совместим с блоками питания, которыми оснащались более старые модели асиков.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(6199, 1, 1, 0, 1, 'БП MYRIG 12V 1680W', 'bp-myrig-12v-1680w', '<p>БП MYRIG обеспечивают максимальную мощность 1240 Вт, если он подключен к сетевому источнику питания 110 В. Чтобы получить номинальную мощность 1680 Вт, должен быть подключен к источнику питания 220 В. Перед заказом проверьте электропитание, которое является стандартным в вашем регионе.</p>\r\n<p>БП MYRIG поставляется только с 10 разъемами PCIe, поэтому их нельзя использовать с более чем одним майнером Antminer S9/T9/D3/L3+.</p>\r\n<p>&nbsp;</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
(6213, 1, 1, 0, 1, 'DRAGONMINT T1 16TH/s + БП MYRIG', 'dragonmint-t1-16th-s-bp-myrig', '<p>DragonMint 16TH/s – последняя новинка на рынке оборудования для добычи Bitcoin, созданная компанией Halong Mining. Исходя из заявленных характеристик, более эффективного майнера SHA-256 на сегодняшний день не существует.</p>\r\n<p>Основная «изюминка» конструкции майнера – это чипы DM8575 . Именно они обеспечивают высокий хешрейт и энергоэффективность устройства, которая равна 0,075J/GH. DragonMint оснащен двумя вентиляторами, обеспечивающими нормальную работоспособность при температурах от 0 до +25.</p>\r\n<p>Над созданием данного майнера на протяжении года трудилось множество экспертов (одни занимались разработкой программного обеспечения, другие – аппаратного обеспечения, третьи – проектировали чипы). При этом была проведена огромная исследовательская работа. В результате, Halong Mining все-таки удалось выпустить уникальный продукт – DragonMint 16TH/s, обладающий великолепными техническими и эксплуатационными характеристиками.</p>', '', 1, 0, 0.00, 0.00, 0, '2018-06-20 07:23:26', '2018-06-20 07:23:26'),
